IF EXISTS(SELECT 1 FROM sys.tables WHERE object_id = OBJECT_ID('Nurse'))
BEGIN;
    DROP TABLE [Nurse];
END;
GO

CREATE TABLE [Nurse] (
    [NurseID] INTEGER NOT NULL,
    [FirstName] VARCHAR(255) NULL,
    [LastName] VARCHAR(255) NULL,
    [Street] VARCHAR(255) NULL,
    
);
